import React from "react";
import Typical from "react-typical";

const login = () => (
  <div>
    <Typical
      steps={[
        "Login Page",
        3000,
        "Still in Development",
        5000,
      ]}
      loop={Infinity}
      wrapper="h2"
    />

    <form>
      <div>
        <label>Username</label>
        <input type="text" /> 
      </div>
    </form>
  </div>
);

export default login;
